script: |
  super -f text -I q5690.spq | sort > q5690.out

inputs:
  - name: q5690.spq
    data: |
      SELECT * FROM tab1 (FORMAT parquet) cor0 WHERE NOT - col2 + + ( 45 + col1 ) * 0 > ( - col1 - 31 ) OR - col0 + col2 <> NULL;
  - name: tab1

outputs:
  - name: q5690.out
    data: |
      51	14	96
      85	5	59
